INSERT INTO `projet` VALUES (1,'2021-05-31','2021-03-15 15:02:33.977000','Notre association Doux repos permet aux maisons de retraite ayant un partenariat avec nous, d\'amener notre humanisme envers les personnes Ã¢gÃ©es.\r\nNous sommes une petite association de jeunes situÃ©e au nord-est de Paris et nous manquons cruellement d\'infrastructure mÃ©dicale  pour prendre correctement en charge tous nos partenaires.','Nous sommes Ã  la recherche de matÃ©riel mÃ©dical pour les maisons de retraite ORPEA tel que des lits mÃ©dicalisÃ©s, de fauteuils roulants, ou tout autre matÃ©riel susceptible de rendre plus agrÃ©able le sÃ©jour des personnes vieillissantes.\r\n\r\nNous acceptons aussi bien Ã©videmment vos dons monÃ©taires ou alors un peu de votre temps si vous voulez nous aider Ã  donner un coup de jeune Ã  ces endroits ainsi que pour l\'installation du matÃ©riel. \r\n\r\nEncore merci pour ces personnes et de votre participation.\r\n',_binary '',_binary '',9000,0,'PUBLIE','MatÃ©riel mÃ©dical pour les maisons de retraite',2,1),(2,'2021-04-30','2021-03-15 14:58:30.354000','L\'association Eclipse vient en aide aux HÃ´pitaux de France demandant un appuie matÃ©riel consÃ©quent. Nous sommes une Ã©quipe de bÃ©nÃ©vole jeune et dynamique dans cette pÃ©riode difficile. Toute aide sera prÃ©cieuse pour les malades et les praticiens.','Les hÃ´pitaux de France sont dans un besoin constant de matÃ©riel mÃ©dical ainsi que de besoin humain pour faire face Ã  cette pÃ©riode de crise telle que la COVID 19. Nous mettons en Å“uvre le transport des marchandises pour les aidÃ©s au quotidien. \r\n\r\nNous avons besoin de votre aide financiÃ¨rement ou matÃ©riellement pour leur donner le maximum de masque chirurgical ainsi que tout matÃ©riel possible pour favoriser la guÃ©rison des malades de la COVID 19 et surtout leur aprÃ¨s...\r\n\r\nSi vous Ãªtes kinÃ©, les hÃ´pitaux de France ont besoin d\'un maximum de vos talents pour rÃ©adapter les malades au niveau respiration aprÃ¨s avoir survÃ©cu Ã  la COVID-19.',_binary '',_binary '',15000,0,'PUBLIE','Les masques de nos vies',2,2),(3,'2021-06-30','2021-03-15 12:46:48.251000','Notre association est nÃ© il y a 10ans pour permettre de donner l\'autonomie aux personnes ayant des handicaps moteurs psychique,...','C\'est pour cela que nous souhaitons acheter des vÃ©los adaptÃ©s, Ã  assistance Ã©lectrique, pour permettre Ã  des personnes en situation de handicap de faire du vÃ©lo afin d\'aller se promener au-delÃ  de notre territoire.\r\n\r\nIl m\'est arrivÃ© assez souvent d\'aller faire de belles balades avec des cyclistes de notre foyer.\r\nMalheureusement, beaucoup de personnes ne peuvent pas bÃ©nÃ©ficier de ces sorties cyclistes. Nous avons bien un tandem pour emmener nos rÃ©sidents qui ont une relative autonomie, mais jamais nous ne pouvons-nous permettre d\'emmener ces personnes pour des balades d\'une heure ou plus. Et pourtant il y a beaucoup de demandes et de besoins auxquels ces sorties rÃ©pondent.\r\nVoilÃ  dÃ©jÃ  prÃ¨s de 2 ans maintenant, que le projet VÃ©lo pour Tous a mÃ»ri et que je rÃ©flÃ©chis Ã  des solutions qui nous permettraient d\'emmener en sortie vÃ©lo toutes ces personnes EXTRAordinaires (en fauteuil ou pas).\r\n',_binary '',_binary '\0',40000,0,'PUBLIE','Un VÃ©lo pour TOUS',3,3),(4,'2021-07-31','2021-03-15 15:14:11.222000','Sand Lor organise cette cagnotte solidaire au nom de Laure RenÃ©.','Un an sÃ©pare ces 2 photos\r\n\r\nUn an aprÃ¨s la dÃ©couverte de ce cancer du sein hyper agressif, un an aprÃ¨s toutes les Ã©tapes invasives et la fatigue, les moments d\'espoir et de dÃ©sespoir,  aprÃ¨s 4 chimiothÃ©rapies diffÃ©rentes, radiothÃ©rapie, chirurgie, le cancer a continuÃ© Ã  progresser en envahissant poumon et ganglion. La seule option est l\'immunotherapie associÃ©e Ã  la vaccinotherapie et la chimiothÃ©rapie.\r\nMalheureusement pour les deux premiers, seule une clinique en Allemagne peut les faire.\r\n\r\nTu gardes ton sens de l\'humour malgrÃ© ces coups de la vie qui petit Ã  petit te coÃ»tent la tienne.\r\n\r\nCe traitement, c\'est ta derniÃ¨re carte Ã  jouer, nous allons nous mobiliser pour raviver cette flamme que tu as en toi !\r\n',_binary '\0',_binary '\0',100000,0,'PUBLIE','Aidez Laure dans son combat contre le Cancer',4,4),(5,'2021-08-15','2021-03-15 15:18:36.867000','Dimitri Perrier et Nicolas Gautry organisent cette cagnotte solidaire pour Mikhael KROTOV.\r\n','Bonjour,\r\n\r\nJe mâ€™appelle Mikhael Krotov. Je suis pÃ¨re de famille, jâ€™ai 38 ans, et dâ€™ici quelques mois je nâ€™aurai plus lâ€™usage de mes poumons.\r\n\r\nJe souffre dâ€™une maladie gÃ©nÃ©tique rare, la dyskÃ©ratose congÃ©nitale, qui a tout fait basculer en trÃ¨s peu de temps. Heureusement jâ€™ai un espoir, qui rÃ©side Ã  Pittsburgh, aux Etats-Unis, oÃ¹ une Ã©quipe de mÃ©decins de l\'UPMC a mis au point un protocole qui pourrait me sauver. Pour moi, pour ma femme, pour nos 3 enfants, ce serait un miracle.\r\n\r\nAu-delÃ  de moi, ce serait aussi un pas de plus dans une trÃ¨s grande avancÃ©e mÃ©dicale menÃ©e par les meilleurs spÃ©cialistes, un miracle pour tous les malades nÃ©cessitant une combinaison de greffes complexes comme la mienne.\r\n\r\nCe miracle est trÃ¨s onÃ©reux (estimÃ© Ã  1 million de dollars), il me faut de lâ€™aide pour le financer. C\'est pourquoi mes proches lancent simultanÃ©ment des cagnottes Ã  travers le monde afin de faire face Ã  une partie de cette somme, ce qui permettra d\'enclencher le processus de soin, une premiÃ¨re Ã©tape dÃ©cisive sans quoi rien n\'est possible.\r\n\r\nS\'il-vous-plaÃ®t partagez mon histoire et donnez 10 euros, 20 euros, ou ce qui vous semble raisonnable. Je vous devrai la vie.\r\nPour suivre mon histoire ou pour accÃ©der Ã  d\'autres moyens de paiement: Blog Sauver Mikhael Krotov.\r\n\r\n#SaveMikhaelKrotov\r\n',_binary '\0',_binary '\0',250000,0,'PUBLIE','Sauvons Mikhael greffe de poumons',4,5),(6,'2021-05-20','2021-03-15 14:11:41.046000','Funds go to Social & Economic Action for Lebanon, Inc.\r\n','Former NBA basketball player and music producer Rony Seikaly is quickly responding to the tragic explosion in Beirut and needs your support. He is personally donating $100,000 to relief efforts in Lebanon. But he urgently needs your help to reach more people in need.\r\n\r\nMore than 300,000 people are left homeless after a massive explosion devastated Beirut on August 4. At least 137 people have died, more than 5,000 are injured, and many are still missing. With the Beirut Port destroyed, the country is left with only a few days worth of food and medical supplies. \r\n\r\nRony partnered with SEAL, a 501(c)3 non-profit organization founded in New York City, to help with this immediate crisis. Launched in 1997 by a group of Lebanese-Americans, SEAL has since played a critical role in helping underserved communities in Lebanon.\r\n\r\nSEAL will direct the funds in full transparency to well-vetted NGOs based in Lebanon. Their focus is on: Shelter, Food, Medication/Medical Support, and Rehabilitation.\r\n\r\nTo date, the following NGOs have been selected: the Lebanese Red Cross, Beit El Baraka, Arcenciel, AlGhina, Lebanon Needs, Nusaned, and Offre Joie. Others are currently being vetted. \r\n\r\nJoin Rony in response to this devastating tragedy. Every donation, no matter how small, counts more than you know.\r\n\r\nAll donations are fully tax-deductible.\r\n',_binary '',_binary '\0',600000,0,'PUBLIE','Help Lebanon with Rony Seikaly',5,6),(7,'2021-07-22','2021-03-15 14:17:06.151000','Lâ€™Ã©cole, chacun y a droit ! Elle donne sa chance Ã  chaque enfant et lui laisse entrevoir la perspective dâ€™une vie meilleure.\r\n','Lâ€™Ã©cole, chacun y a droit ! Elle donne sa chance Ã  chaque enfant et lui laisse entrevoir la perspective dâ€™une vie meilleure.\r\nMais aujourdâ€™hui dâ€™Ã©cole il nâ€™y a plus ! Le lac Baringo a vu ces derniÃ¨res annÃ©es son niveau monter, monter, jusquâ€™Ã  inonder une trÃ¨s grande partie du village de naissance de Simon. De nombreuses habitations, des hÃ´tels, lâ€™infirmerie,